import styled from 'styled-components';
import { Container, Grid, Paper } from '@material-ui/core';

const Coding = () => {
    return (
        <Container fixed>
            <Grid container>
                <Grid item xs={12} fullWidth>
                    <Title>Coding expirience</Title>
                </Grid>
                <Grid item xs={4} fullWidth>
                    <Paper>1</Paper>
                </Grid>
                <Grid item xs={4} fullWidth>
                    <Paper>2</Paper>
                </Grid>
                <Grid item xs={4} fullWidth>
                    <Paper>3</Paper>
                </Grid>
            </Grid>
        </Container>
    );
};

export default Coding;

const Title = styled.p`
    margin-top: 0rem;
    color: white;
    font-size: 4rem;
`;
